import { getAllwebmasters } from "apis/userApi";
import React, { useState, useEffect, useCallback } from "react";
import { useHistory } from "react-router-dom";

import MTableAdmin from "../../components/aidchannel/superadmin/MtableAdmin";

const ListWebMasters = () => {
  const [webmaster, setWebmaster] = useState([]);

  const history = useHistory();
  // const [codeCountry, setCountry] = useState();
  // const country = await getCountryByCode(codeCountry);

  const getDataFromApi = useCallback(async () => {
    const webmaster = await getAllwebmasters();
    setWebmaster(webmaster?.reverse());
  });

  useEffect(() => {
    getDataFromApi();
  }, [getDataFromApi]);

  return (
    <div className="container">
      <>
        <h1>WebMasters</h1>
        <hr />
        <button
          onClick={() => history.push(`/super-admin/add-webmaster/`)}
          className="btn  ml-3 shadow-none border-none"
          style={{ backgroundColor: "black", color: "white" }}
        >
          Add
        </button>

        <MTableAdmin data={webmaster} />
      </>
    </div>
  );
};

export default ListWebMasters;
